def solution(road, n):
    answer = -1
    nowMax = 0
    start = 0

    for end in range(1,len(road)):
        temp = abs(start - end) + 1
        # print(start, end)
        # print(road[start:end+1])
        # print(nowMax)
        if road[start:end+1].count("0") <= n:
            nowMax = max(nowMax, temp)
        else:
            for i in range(start,end):
                if road[i] == "0":
                    start = i+1
                    break

    print(nowMax)
    # print(len(road))
    return answer

