def solution(l1,l2):
    answer = []
    answer.append(l1)
    if l2 not in answer:
        answer.append(l2)
    if l1 > l2:
        a = l2+l2
        while l1 > a:
            if a not in answer:
                answer.append(a)
            a += l2
    else:
        a = l1 + l1
        while l2 > a:
            if a not in answer:
                answer.append(a)
            a += l1
    answer.sort()
    print(answer)

solution(3,2)